        "job_description": "Duration: 6 month contract with potential to extend or be hired as a full time associate.\n\nLocation: Remote during contract, will require relocation to Dallas, TX or Bentonville, AR if converted to a full time hire!\n\nInterview Process: 1 round with client\n\nMust-haves\n\nRelocation to Bentonville, AR or Dallas, TX upon conversion at 6 months is required\n\n2+ years of experience as a Python Developer (6+ years for Senior role)\n\nData engineering experience (ETL)\n\nExperience developing data pipelines and ML systems\n\nProduction support and CICD deployment experience\n\nBigQuery experience or equivalent\n\nPyspark and Pytest experience\n\nJIRA and GIT experience\n\nAirflow experience or equivalent\n\nPlusses\n\nMessaging queue experience (RabbitMQ)\n\nQA experience\n\nDay-to-Day\n\nAn employer is looking for Python Developers for a remote contract opportunity. If this opportunity turns into a contract to hire, you must relocate to Bentonville or Dallas in order to convert to fulltime employee. The project involves updating several inferencing workflows that process large amounts of text to generate named entities such as skills and education. The team will conduct research, attend knowledge transfer sessions, and update the inferencing service and related data pipelines. As a result of these changes, the API contracts for existing services will also need to be updated, and new data workflows will need to be developed and tested to ensure successful deployment.",
