      "job_description": "Agiloft was named a Leader in the 2022 Gartner Magic Quadrant for Contract Life Cycle Management for the third year in a row. Contract Lifecycle Management (CLM) is one of the fastest-growing areas of enterprise sales, with a TAM projected to climb from $2B to $7B in the next 5 years.\n\nThe Agiloft Contract Lifecycle Management platform has won dozens of awards, including the Editor’s Choice award from PC Mag, for the past five years in a row.\n\nAgiloft has a highly differentiated value proposition which is uniquely appealing to enterprises: pre-built applications with a deeply configurable, no-code platform for integrated Business Process Management throughout an organization.\n\nAgiloft is pioneering the applied use of Artificial Intelligence to enable next-generation business commerce at organizations ranging from small enterprises to U.S. government agencies and Fortune 100 companies.\n\nAdditionally, 99% of employees who commented on Glassdoor would recommend Agiloft to a friend.\n\nPosition Overview\n\nThe AI/ML Director will lead an interdisciplinary team of Machine Learning Engineers, Data Scientists, and Product/UX Designers in R&D and delivery of core AI/ML assets in our CLM software-as-a-service platform. The AI/ML Director will lead a team to build training data sets, data pipelines, and processes for model training, testing and analysis. This leader will also be responsible for the overall agile delivery and success of high impact end-to-end solutions built on the AI/ML core assets.\nYou will work closely with product engineering, QA and DevOps teams to coordinate delivery of product-ready code to customers. You will collaborate with customer-facing stakeholders across the organization (product, marketing and professional services) to inform your input to the AI/ML strategy and roadmap. You will proactively gather requirements and feedback from stakeholders that will drive your research priorities and continuous improvement of deliverables. The AI/ML Lead reports directly to the Chief Technology Officer. Using your expertise in applying state-of-the-art AI/ML models and techniques, you will research, select, build, tune and maintain ML models and related assets.\n\nJob Responsibilities\n• Lead the development of AI/ML solutions for core use cases including NLP search, named entity recognition, and generative AI\n• Identify new ways of applying AI/ML to positively impact the user experience and delight customers\n• Define and communicate the strategy, roadmap, goals, tasks and priorities to the AI/ML Engineering team and be accountable for team results\n• Encourage collaboration and facilitate healthy working relationships between team members and with stakeholders\n• Gather business requirements and stakeholder expectations, and translate them into a well-described and manageable strategy, roadmap and set of deliverables\n• Collaborate with AI/ML engineers, application development engineers, legal knowledge engineers and QA personnel to support AI/ML model development and testing\n• Ensure the AI/ML tools and methods used in projects are robust and of the highest quality\n• Champion and foster the application of AI/ML in the company through presenting, teaching and coaching\n• Other duties as assigned\n\nRequired Qualifications\n• 5-7 years of experience leading machine learning R&D\n• 3-5 years of experience leading development of NLP commercial solutions\n• B.Sci Degree (advanced degree preferred) in AI, Data Science, Statistics, Computer Science, Mathematics, or a related quantitative field\n• Strong foundational knowledge of AI/ML, NLP, neural networks, large language models, transformer models, generative AI, named entity recognition.\n• Expert level proficiency in AI/ML tools and languages, (e.g., Python, R, etc.)\n• Experience building, training and using AI models used in commercial software products\n• Able to translate business needs into strategy, research projects, technical requirements, and product engineering specifications\n• Authoritative knowledge and ability to teach others about state-of-the-art in AI/ML models\n• Deep experience with AI open-source ecosystem (e.g., Hugging Face) – options available, strengths and weaknesses, licensing\n• Experience with selecting, curating and maintaining training data corpuses\n• Understanding of training data provenance\n• Understanding of computer security and data privacy principles and best practices\n• Understanding of operational performance, system resource requirements and limits\n\nPreferred Qualifications\n• Contributor to AI open source ecosystem\n• Experience with OCR services and techniques\n• Experience with and certifications in commercial cloud services (e.g., AWS Sagemaker)\n• Experience with data privacy (e.g., GDPR, PII) and working in a security compliant environment (e.g., SOC2, ISO27001)\n• Experience with Agile/Scrum development process\n• Experience in a SaaS product company\n• Experience presenting AI/ML topics in an academic or professional arena\n• Experience representing and explaining technical topics clearly to non-technical stakeholders\n• Understanding of commercial legal contract concepts, terms, entities, clauses and semantics\nEnsuring a diverse and inclusive workplace is our priority. We are committed to an environment of acceptance where you are free to bring your full self to work. All employment decisions at Agiloft are based on business needs, job requirements, and individual qualifications without regard to race, color, religion or belief, national or social ethnic origin, sex, age, sexual orientation, gender identity and/or expression, parental status, marital status, Veteran status, or any other status protected by the laws or regulations in the locations where we operate. If you have a need that requires accommodation during the recruiting process, please let us know by contacting Director, Talent Acquisition, Brad Toothman at brad.toothman@agiloft.com.\n\nApplicants from underrepresented groups such as minorities, veterans, or individuals with disabilities encouraged to apply.",
