      "job_apply_is_direct": false,
      "job_apply_quality_score": 0.5788,
      "job_description": "Are you passionate about shaping the future of AI and making a difference in the lives of the next generation of technology leaders?\n\nFounded with a vision to ignite young minds' curiosity in Artificial Intelligence and provide hands-on experience, the Deltaschool AI Fellowship offers students an immersive AI learning journey. Through masterclasses led by industry experts, mentorship from graduates and current PhD students from top-tier universities, and collaboration with other fellows, our students not only learn the fundamentals of AI but also apply their newfound knowledge to create solutions for real-world problems.\n\nWe are currently seeking driven and proficient AI Mentors to guide and inspire the next generation of AI talent. As an AI Mentor, your role will involve nurturing students' curiosity, helping them surmount challenges, and motivating them to develop groundbreaking projects that can revolutionize the world.\n\nOur upcoming AI Fellowship runs from July 30, 2023 to August 27, 2023.\n\nYour responsibilities as an AI Mentor will include:\n• Meeting with high school students over Zoom to answer questions, solve problems, and help them complete their own independent AI project over the course of the fellowship\n• Responding to student messages within 48 hours\n\nOur ideal candidate:\n• Is a current PhD candidate or graduate from a top-tier university in Computer Science, AI, or a related field\n• Has significant experience in building projects with AI or machine learning\n• Demonstrates a strong understanding of Python and is familiar with LLMs, AI libraries, and APIs.\n• Possesses excellent communication and teaching skills.\n• Has a passion for education and a commitment to mentor ambitious high schoolers who are interested in artificial intelligence\n\nWhy join us at Deltaschool?\n• Competitive Compensation: We offer competitive hourly rates that recognize your expertise and the value you bring to our team.\n• Flexible Hours: We understand the need for work-life balance. With us, you can tailor your work schedule according to your needs.\n• Global Impact: By joining us, you will have the opportunity to inspire and educate top high school students from around the globe, helping shape the future of AI.\n• Rewarding Experience: There's no greater joy than imparting your knowledge and igniting a passion for AI in the minds of young, eager students.\n\nIf you have a burning passion for AI, a knack for teaching, and a desire to make a substantial contribution to AI education, we would love to hear from you. Join us in our mission to demystify the world of Artificial Intelligence for our students. We will consider applications on a rolling basis for the upcoming fellowship and future programming, so apply today!\n\nPlease keep an eye on your spam / junk email folder for correspondence from the Deltaschool team.",
