        "job_apply_quality_score": 0.5477,
        "job_description": "If you are a Lead Backend Python Developer/Engineer with experience, please read on!\n\nOur Digital Fundraising Platform form is designed from the ground up to offer a wonderful giving experience that allows donors the freedom to contribute how, where, when, and what they choose. In todays society Donors want their giving experiences to be smart and simple, especially considering they are socially connected, mobile, and online savvy.\n\nCome join our team! Right now we are in search of a talented Lead Backend Python Developer/Engineer.\n\nTop Reasons to Work with Us\n\n$150-$180,000/ year salary\n• REMOTE POSITION\n• Vacation/PTO: unlimited\n• Medical\n• Dental\n• Vision\n• 401k\n\nWhat You Will Be Doing\n\nThe most important aspect of this individual will be that they are a self-starter and can get running on day one.\n\nvery senior, driven, problem-solver and have an excellent ability to drive at the Lead Engineer level.\n\nExpertise in multiple programming languages, primarily Python, JavaScript and TypeScript\n\nExtensive knowledge of software engineering principles, design patterns, and best practices for developing efficient, maintainable, and high-performing software applications.\n\nDemonstrate experience in leading the design, development, testing, and deployment of full-stack applications, through all stages of the software development lifecycle (SDLC).\n\nExperience in architecting and implementing scalable, secure, robust backend systems. Including microservices, APIs, and database design using modern frameworks and technologies.\n\nAbility to mentor and lead a development team by setting code quality standards, conducting code reviews, and providing guidance on best practices in software development.\n\nStrong understanding of cloud computing platforms, such as AWS and expertise in designing and deploying infrastructure as code. Containerization using Docker, ECS and/or Kubernetes.\n\nContinuous integration and deployment (CI/CD) methodologies, using tools like Jenkins, GitLab, or GitHub Actions to ensure the development and release of high-quality software.\n\nImplementing and managing secure software development environments, ensuring adherence to industry-standard security best practices, and managing the overall security posture of the software applications.\n\nExcellent communication skills, enabling them to work effectively with cross-functional teams, including product management, UX/UI design, quality assurance, and other internal stakeholders.\n\nWhat You Need for this Position\n\nMinimum 8 years of PROFESSIONAL experience as a Developer/Engineer working with Python (internships & personal projects not included).\n• Lead Backend Developer position held previously\n• Extremely strong Python skills\n• Strong AWS knowledge\n• Very strong PostgreSQL\n\nThrives in a fast-paced environment.\n\nHighly communicative work style.\n\nBenefits\n• Vacation/PTO\n• Medical\n• Dental\n• Vision\n• 401k\n\nSo, if you are a Lead Python Developer with experience, please apply today!\n\nColorado employees will receive paid sick leave. For additional information about available benefits, please contact Clint Naegel\n\nEmail Your Resume In Word To\n\nLooking forward to receiving your resume through our website and going over the position with you. Clicking apply is the best way to apply, but you may also:\n\nClint.Naegel@CyberCoders.com\n• Please do NOT change the email subject line in any way. You must keep the JobID: linkedin : CN2-1750257 -- in the email subject line for your application to be considered.***\n\nClint Naegel - Sr. Executive Recruiter - CyberCoders\n\nApplicants must be authorized to work in the U.S.\n\nCyberCoders is proud to be an Equal Opportunity Employer\n\nAll qualified applicants will receive consideration for employment without regard to race, color, religion, sex, national origin, disability, protected veteran status, or any other characteristic protected by law.\n\nYour Right to Work – In compliance with federal law, all persons hired will be required to verify identity and eligibility to work in the United States and to complete the required employment eligibility verification document form upon hire.",
